var months = data.months.length;

function monthToString(monthNumber){
  switch(monthNumber){
    case 1:
    return "January";
    case 2:
    return "February";
    case 3:
    return "March";
    case 4:
    return "April";
    case 5:
    return "May";
    case 6:
    return "June";
    case 7:
    return "July";
    case 8:
    return "Augost";
    case 9:
    return "September";
    case 10:
    return "October";
    case 11:
    return "November";
    case 12:
    return "December";
    default:
    return "Error";
  }
}

var firstMonth = data.months[0];
var chartData = [];
for(i=0; i<data.months.length; i++){
  var month = data.months[i].month - 1;
  for(j=0; j<data.months[i].days.length; j++){
    var day = data.months[i].days[j].day;
    var images = data.months[i].days[j].images.length;
    chartData.push({date: new Date(data.year, month, day), count: images});
  }
}

var heatmap = calendarHeatmap()
                .data(chartData)
                .selector('.heatmap')
                .tooltipEnabled(true)
                .colorRange(['#f4f7f7', '#79a8a9'])
                .onClick(function (data) {
                  console.log('data', data);
                });
heatmap();  // render the chart

var AMOUNT_OF_IMAGES_PER_ROW = 16;
var SQUARE_SIZE = 25;
var SQUARE_PADDING = 6;
var BASE_DIRECTORY = "C:\\cygwin\\Camera\\";
var onClick = function(d){
  document.getElementById("display-image").setAttribute("src", BASE_DIRECTORY+d.name);
};

var year = document.getElementById("photos");
year.innerHTML = data.year;


for(i=0; i<data.months.length; i++){
  var monthNumber = data.months[i].month - 1;
  var monthDiv = document.createElement('div');
  monthDiv.setAttribute("class", "month");
  monthDiv.setAttribute("id", "month"+monthNumber);
  monthDiv.innerHTML = monthToString(monthNumber+1);
  monthDiv.appendChild(document.createElement('br'));

  monthDiv.appendChild(document.createElement('br'));

  year.appendChild(monthDiv);
  for(j=0; j<data.months[i].days.length; j++){
    var dayNumber = data.months[i].days[j].day;
    var dayDiv = document.createElement('div');
    dayDiv.setAttribute("id", "day"+dayNumber+"month"+monthNumber);
    dayDiv.setAttribute("class", "day");
    dayDiv.setAttribute("style", "display:flex");
    var daySpan = document.createElement('span');
    var date = new Date(2017, monthNumber, dayNumber);
    daySpan.innerHTML = moment(date).format('ddd Do');;
    daySpan.setAttribute('style', 'width:120px')
    dayDiv.appendChild(daySpan);
    monthDiv.appendChild(dayDiv);
    var amountOfImages = data.months[i].days[j].images.length;
    var amountOfRows = Math.ceil(amountOfImages / AMOUNT_OF_IMAGES_PER_ROW);
    var svgWidth = AMOUNT_OF_IMAGES_PER_ROW*(SQUARE_SIZE+SQUARE_PADDING);
    var svgHeight = amountOfRows*(SQUARE_SIZE+SQUARE_PADDING);
    var svg = d3.select("#"+"day"+dayNumber+"month"+monthNumber)
      .style('position', 'relative')
      .append('svg')
      .attr('width', svgWidth)
      .attr('class', 'day-images')
      .attr('height', svgHeight)
      .style('padding', '12px');

      imageRects = svg.selectAll('.image-cell')
        .data(data.months[i].days[j].images);  //  array of images of the day

      imageRects.enter().append('rect')
        .attr('class', 'image-cell')
        .attr('width', SQUARE_SIZE)
        .attr('height', SQUARE_SIZE)
        .attr('fill', function(d) { return 'rgb('+d.maxColor.r+","+d.maxColor.g+","+d.maxColor.b+')'; })
        .attr('x', function (d, i) {
          return (i%AMOUNT_OF_IMAGES_PER_ROW)*(SQUARE_SIZE+SQUARE_PADDING);
        })
        .attr('y', function (d, i) {
          return Math.floor(i/AMOUNT_OF_IMAGES_PER_ROW)*(SQUARE_SIZE+SQUARE_PADDING);
        })
        .attr('stroke', 'black')
        .attr('stroke-width', '1px');


      if (typeof onClick === 'function') {
        imageRects.on('click', function (d) {
          onClick(d);
        });
      }

  }
}
